// fetch dishes from recipes.json
// and display them in a list
import React, { useState, useEffect } from "react";
import recipes from "../data/recipes.json";

export function Dishes() {
  // display initialState
  return (
    <div>
      <h1>Dishes</h1>
      <p>fetching dishes...</p>
      {recipes.map((dish) => (
        <div>{recipes.dish}</div>
      ))}
    </div>
  );
}
